import React from 'react';
import './Tutorial.css';

function Tutorial() {
    return(
        <div className="tutorial">
            <iframe width="560" height="315" src="https://www.youtube.com/embed/k4NTf0hMjtY?start=113" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
        </div>
    );
}

export default Tutorial
